var JsomWebPartTest =  (function () {
    function JsomWebPartTest() {
        this.jsomWebPartId = '2d59aca9-f84c-407c-95f5-7b427bcb1ef4_0';
    }
    JsomWebPartTest.prototype.TestName = function () {
        return 'JSOM Web Part Test';
    };
    JsomWebPartTest.prototype.TestOwner = function () {
        return 'patsppplat';
    };
    JsomWebPartTest.prototype.TestOwnerTeam = function () {
        return 'DevPlat\\SPFX';
    };
    JsomWebPartTest.prototype.TestIncludeScripts = function () {
        return [
            '<ProductScriptsLocation>msajaxbundle.debug.js',
            '<ProductScriptsLocation>sp.runtime.debug.js',
            '<ProductScriptsLocation>sp.debug.js',
            '<TestLocation>/TabTaskLib.debug.js',
            '<AzureTaskLibLocation>/sp-tab-tasklib.js'
        ];
    };
    JsomWebPartTest.prototype.TestSetup = function () {
        var azurePath = TAB.Settings.Get('AzurePath');
        var loaderUrl = azurePath + "/sp-webpart-workbench-assembly_default.js";
        SPTaskLib.PageUtil.SetDebugManifests({ loaderUrl: loaderUrl });
        TAB.Log.Comment('JSOM Web Part test start');
    };
    JsomWebPartTest.prototype.TestRun = function () {
        var pageContentClassName = SPTaskLib.Pages.Workbench.pageContentClassName;
        SPTaskLib.PageUtil.AddTaskCreateWorkbench();
        var jsomWebPart = new SPTaskLib.Controls.BaseWebpart(SPTaskLib.Controls.WebpartType.Unknown, this.jsomWebPartId);
        SPTaskLib.Pages.Canvas.AddTaskCreateWebPart(jsomWebPart, pageContentClassName);
        SPTaskLib.PageUtil.AddTaskValidateAutomationIdExists('JsomWebPartSuccess');
        TAB.Log.AddTaskPass('Test complete');
    };
    return JsomWebPartTest;
}());
TabTest = JsomWebPartTest;
